Cannot delete document from local.system.replset when authentication enabled<p>I have MongoDB replica set with enabled authentication. I want to change replica set name. In order to do that I have to delete documents from <code>local.system.replset</code> collection. I have admin user with  <code>root@admin</code> role assigned, also I have regular user with <code>readWrite@local</code> role. When I try to execute <code>remove</code> from  the shell with any of the users above I get <code>Unauthorized</code> exception:</p>

<pre><code>&gt; db.system.replset.remove({})
WriteCommandError({
        "operationTime" : Timestamp(1582026365, 1),
        "ok" : 0,
        "errmsg" : "not authorized on local to execute command { delete: \"system.replset\", ordered: true, lsid: { id: UUID(\"43182bad-b13d-4ff4-a31b-3cdcb1dd49fa\") }, $clusterTime: { clusterTime: Timestamp(1582026355, 1), signature: { hash: BinData(0, E9FD8A23702CE215B193423CAF1C2AF3FEE83D6B), keyId: 6794747247067136002 } }, $db: \"local\" }",
        "code" : 13,
        "codeName" : "Unauthorized",
        "$clusterTime" : {
                "clusterTime" : Timestamp(1582026365, 1),
                "signature" : {
                        "hash" : BinData(0,"CyCvFtgLkpdhIrsJV67KBlVwL+U="),
                        "keyId" : NumberLong("6794747247067136002")
                }
        }
})
</code></pre>

<p>If I try to execute same command on replica set with no authentication enabled I can successfully remove the record. What role am I missing on order to let user to delete record from <code>local.system.replset</code>? Or is it not supported when authentication is enabled?</p>

