Can I use the dot character (.) for a field name in Mongo DB?<p>I'm using MongoDb to store JSON data. One of the documents I have contains a deeply nested JSON with values such as the following:</p>

<p>......</p>

<pre><code>"value-3.4": {
                  "submit-message": {
                     "enabled": "false"
                  },
                  "dlr-tlvs": {
                     "parse-value": "true",

                  }
               }
            }

</code></pre>

<p>...</p>

<p>I've got a node.js application using "mongodb": "^3.5.3" which connects to my DB reads, the json data and try to push it to the database using something like the following. Note that datito is the json object that comes from an external file.</p>

<pre><code> try {
                                                     db.collection('config').insertOne(
                                                         datito
                                                     ).then(function(err) {
                                                      console.log(err);
                                                      // expected output: "Success!"
                                                    })
                                                  } catch (e) {
                                                     console.log(e);
                                                  }
</code></pre>

<p>The problem is that when I try to push the data, I get an error because the field name contains a "." 
I've read that since Mongo 3.6, <a href="https://docs.mongodb.com/manual/reference/limits/#Restrictions-on-Field-Names" rel="nofollow noreferrer">https://docs.mongodb.com/manual/reference/limits/#Restrictions-on-Field-Names</a> this shouldn't be a problem. However, it seems that the latest version published in npm is 3.5.3. </p>

<p>I've also followed these instructions to update Mongo to 3.6 <a href="https://docs.mongodb.com/v3.6/installation/" rel="nofollow noreferrer">https://docs.mongodb.com/v3.6/installation/</a> but it seems that it will make no difference as I'm pushing the data from my nodejs application rather than the Mongo shell. Does it make sense?</p>

<p>Could you please advise if I'm getting confused between my mongodb version in my nodejs application vs the Mongo DB version I have 4.2.3?</p>

<p>When I run mongo --version in my CLI I've got:</p>

<p>MongoDB shell version v4.2.3</p>

<p>But my nodejs application seems to be using 3.5.3. Is this assumption correct and hence I should rename the field of my json to not contain "."?</p>

<p>I appreciate your help.</p>

<p>Thanks</p>

